class Solution:
    def maximumGain(self, s: str, x: int, y: int) -> int:

        if x > y:

            stack = []
            count = 0
            for i in s:
                if stack and i == "b" and stack[-1] == "a":
                    stack.pop()
                    count += x
                else:
                    stack.append(i)

            t = "".join(stack)

            stack = []

            for k in t:
                if stack and k == "a" and stack[-1] == "b":
                    stack.pop()
                    count += y
                else:
                    stack.append(k)

            return count

        else:

            stack = []
            count = 0
            for i in s:
                if stack and i == "a" and stack[-1] == "b":
                    stack.pop()
                    count += y
                else:
                    stack.append(i)

            t = "".join(stack)

            stack = []

            for k in t:
                if stack and k == "b" and stack[-1] == "a":
                    stack.pop()
                    count += x
                else:
                    stack.append(k)

            return count




solution = Solution()
print(solution.maximumGain("", 4134, 8218))
